import React from 'react'
import listSvg from  '../assets/img/list.svg'

const List = (props) =>{
    const label = PushSubscriptionOptions.label
    return (
        <ul className="todo__list">
            <li>
            <i><img src={listSvg} alt="list icon"/></i> 
            <span>{label}</span>
            </li>
        </ul> 
    );
};

export default List;
